  dhm(t){


    var cd = 24 * 60 * 60 * 1000,
        ch = 60 * 60 * 1000,
        d = Math.floor(t / cd),
        h = Math.floor( (t - d * cd) / ch),
        m = Math.round( (t - d * cd - h * ch) / 60000),
        pad = function(n){ return n < 10 ? n : n; };
      if( m === 60 ){
        h++;
        m = 0;
      }
      if( h === 24 ){
        d++;
        h = 0;
      }

      

      this.datos1.dias = d;
      this.datos1.horas = pad(h);
      this.datos1.minutos = pad(m);

}

  dhm2(t){

    var cd = 24 * 60 * 60 * 1000,
    ch = 60 * 60 * 1000,
    d = Math.floor(t / cd),
    h = Math.floor( (t - d * cd) / ch),
    m = Math.round( (t - d * cd - h * ch) / 60000),
    pad = function(n){ return n < 10 ? n : n; };
      if( m === 60 ){
      h++;
      m = 0;
      }
      if( h === 24 ){
      d++;
      h = 0;
      }



      this.datos1.dias = d;
      this.datos1.horas = pad(h);
      this.datos1.minutos = pad(m);



  }
  
